def ProfileMostProbable(text, k, Profile):
    max_profile = 0
    best_string = ""
    for i in range(len(text)-k+1):
        cur_val =text[i:i+k]
        profile = 1
        for j in range(len(cur_val)):
            symbol = cur_val[j]
            num = Profile[symbol][j]
            profile *= num
        if profile > max_profile:
            max_profile = profile
            best_string = cur_val

    return best_string

